import "./CartPage.css"
export const CartTopDiv = () => {
    return (
        <div id="CartTopDiv">
            <div id="item"></div>
            <div id="price"></div>
            <div id="qty"></div>
            <div id="subtotal"></div>
        </div>
    )
}
